import IconButton from '@mui/material/IconButton';
import Stack from '@mui/material/Stack';
import DeleteIcon from '@mui/icons-material/Delete';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';

const Todo = ({todo, index, completeTask, removeTask, handleToggle}) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  }

  return (
      <div id={todo.id} key={todo.key} className={todo.complete ? "todo strike" : "todo "}>
        <FormGroup>
          <FormControlLabel control={<Checkbox color="success"/>} onClick={() => handleClick} label={''}/>
        </FormGroup>
        <p className={'todosText'}>
          {todo.key}
        </p>
        <div className={'btnWrap'}>
          <Stack direction="row" spacing={1}>
            <IconButton onClick={() => removeTask(index)} aria-label="delete">
              <DeleteIcon />
            </IconButton>
          </Stack>
        </div>
      </div>
  );
};

export default Todo;
